La Blue Girl Live 3-Lady Ninja (1996)

The Sex Demons of the Shikima Clan are restless, and their only desire is to find their way to earth and human women! These creatures will spare no effort to revive the child of their king, Hanzaki, who can bridge the gap between dimensions. The child's mother is a Miroku Clan ninja named Miyu, and her entire clan is ready to help defend earth from the encroaching darkness. It is time for the final battle between woman and demon, as the five most beautiful women of the Miroku Clan make their last stand against the Demon Sex magic of the Shikima!

